package com.example.moneytracker.data.db;import androidx.room.Entity;import androidx.room.PrimaryKey;@Entity(tableName = "accounts")public class Account {    @PrimaryKey(autoGenerate = true)    public int id;    public String name;    public String iconName;    public double initialBalance;    public Account(String name, String iconName, double initialBalance) {        this.name = name;        this.iconName = iconName;        this.initialBalance = initialBalance;    }}